import React from "react";
import {titles } from "../../data/data";
const Home = () => {
  return (
    <Container>
      <Foods>
        <Header>
          <User>
            <UserName>Jaegar Resto</UserName>
            <Date>Tuesday, 2Feb 2021</Date>
          </User>
          <Search>
            <i class="fa-solid fa-magnifying-glass"></i>
            <input type="search" placeholder="Search for food, coffe, etc.."/>
          </Search>
        </Header>
        <Category>
          <Title></Title>
        </Category>
      </Foods>
    </Container>
  );
};

export default Home;
